import React from "react";
import { MainTitleStyle } from "../../styles/new_style/MainTitle.style";
import SubTitle from "./Subtitle";

function MainTitle({ title }: { title: string }) {
  return (
    <MainTitleStyle>
      <h1>MainTitle</h1>
      <SubTitle />
    </MainTitleStyle>
  );
}

export default MainTitle;
